85;a:1:{s:7:"caption";s:1225:"Some of my most precious memories with my grandmother are of this wildflower- Akondo. Getting them from the roadside, the dump side... dusty, disgusting places.
Akondo flowers were ubiquitous. Ubiquitous like memories. 
Pods not as much. 
The flowers were huge. Bigger than my face must have been then. The blossoms were tiny and we would pop them (like bubble wrap). 
And she would make me the tiniest cutest pillows from this cotton from the pods.

Last weekend was an adventure of sorts. Good, fun, lonely, happy, crazy, scary a few times. 
Then in a garden of flute and chicken salad sandwiches and native plants and LEGO sculptures and hydrangeas,  was a lonely pod in the parking lot. 
Like a memory waiting to be picked up and brought back home. 
So here she is. 
Home and everywhere else. 
Wild. Free. Ubiquitous. 
